import React from 'react'
import {EachCountry} from "./EachCountry";
import useWindowDimensions from "./Helpers"
export class Countries extends React.Component{
    render(){
        // const data = this.props.data;
        return(
            <div>

                {this.props.data.map(
                        (each)=> <EachCountry key={each.country} objectCount={each.objectCount} objectIDs={each.objectIDs}
                        iso={each.iso} lat={each.latLon[0]} lon={each.latLon[1]} />
                        )}
            </div>
        )
    }

}
